int hit(struct card deck[])
{
    while (1)
    {
        int a;
        srand(time(NULL));
        a = rand() % 52;
        if (deck[a].value != 0)
        {
            return a;
        }
    }
}

void userHit(struct card *deck)
{
    int cardChosen = hit(deck);
    user[userCards] = deck[cardChosen];
    userCards++;
    deck[cardChosen].value = 0;
}

void dealerHit(struct card *deck)
{
    int cardChosen = hit(deck);
    dealer[dealerCards] = deck[cardChosen];
    dealerCards++;
    deck[cardChosen].value = 0;
}

int prevUser = 0;
int prevDealer = 0;

int userScore()
{
	int aceIndex[4];
    int ace = 0;
    int score = 0;
    for (int i = 0; i < userCards; i++)
    {
        if (user[i].value == 11)
        {
			if (user[i].depreciated == 0) {
				aceIndex[ace] = i;
            	ace++;
			}
        }        
        score += user[i].value;
    }
	if (ace > 0) {
		while (score > 21)
		{
			ace--;
			user[aceIndex[ace]].depreciated = 1;
			score = score-10;
			
			if (ace == 0) {
				return score;
			}
		}
	}
    return score;
}

int dealerScore()
{
    int aceIndex[4];
	int ace = 0;
    int score = 0;
    for (int i = 0; i < dealerCards; i++)
    {
        if (dealer[i].value == 11)
        {
            if (dealer[i].depreciated == 0) {
				aceIndex[ace] = i;
            	ace++;
			}
        }
        score += dealer[i].value;
    }
	if (ace > 0) {
		while (score > 21)
		{
			score = score-10;
			ace--;
			dealer[aceIndex[ace]].depreciated = 1;
			if (ace == 0) {
				break;
			}
		}
	}
    return score;
}

// 1 --> dealer won
// 3 --> user won
// 2 --> draw
int winner()
{
    // Someone got 21
    if (dScore != 21 && uScore == 21)
    {
        return 3;
    }            
    if (dScore == 21 && uScore != 21)
    {
        return 1;
    }
    if (dScore == 21 && uScore == 21)
    {
        return 2;
    }    
   
    // Someone is over 21
    if (uScore > 21)
    {
        return 1;
    }
    if (dScore > 21)
    {
        return 3;
    }  
   
    // Whoever is closer to 21 wins
    if ((21-uScore) < (21-dScore))
    {
        return 3;
    }
    if ((21-uScore) > (21-dScore))
    {
        return 1;
    }
    else
    {
        return 2;
    }
}

